ijin_siswa.id_ijin_siswa,
ijin_siswa.idsiswa_fk,
ijin_siswa.tanggal,
ijin_siswa.idjenisijin_fk,
ijin_siswa.keterangan,
ijin_siswa.create_at,
ijin_siswa.idoperator_fk,
